import { getDate } from "src/custom-functions";
import Icon from "src/Components/UI/Icon/Icon";
import classes from "./Product.module.css";
import { CTooltip } from "@coreui/react";
const CTableBody = (props) => {
  return (
    <>
      {props.body.map((row, i) => {
        return (
          <tr key={i}>
            <td>{row.id}</td>
            <td>{row.itemname}</td>
            <td>{row.itemcode}</td>
            <td>{row.count}</td>
            <td>{getDate(row.updated_at)}</td>
            <td>
              <CTooltip content>
                <Icon class={classes.view} name="cil-align-center" />
              </CTooltip>
              |
              <CTooltip>
                <Icon class={classes.delete} name="cil-trash" />
              </CTooltip>
            </td>
          </tr>
        );
      })}
    </>
  );
};
export default CTableBody;
